import React, { useState, useEffect } from 'react';
import './App.css';
import Parse from "parse/dist/parse.min.js";
import { Button, Input, List } from 'antd';
import {
  CheckOutlined,
  CloseOutlined,
  PlusOutlined,
  RedoOutlined,
} from '@ant-design/icons';

const app_id = process.env.REACT_APP_PARSE_APP_ID;
const host_url = process.env.REACT_APP_PARSE_HOST_URL;
const javascript_key = process.env.REACT_APP_PARSE_JAVASCRIPT_KEY;
Parse.initialize(app_id, javascript_key);
Parse.serverURL = host_url;

function App() {
  const [makes, setMakes] = useState([]);

  //READ
  const fetchAllMakes = async () => {
    try {
      const query = new Parse.Query("makes")
      const allMakes = await query.find()
      setMakes(allMakes)
    } catch (error) {
      console.error('Erro na requisição:', error)
    }
  };

  //CREATE
  const createMake = async () => {
    let Makes = new Parse.Object('makes')
    Makes.set('name', "mc saci")
    Makes.set('color', "mc saci")
    Makes.set('category', "mc saci")
    Makes.set('brand', "mc saci")
    try {
      await Makes.save()
      fetchAllMakes()
    } catch (error) { 
      alert('Erro na criação:', error)
    };
  }

  //UPDATE
  const updateMake = async function (makeId, /* done */) {
    let Makes = new Parse.Object('makes');
    Makes.set('objectId', makeId);
    Makes.set('name', "mc saci")
    Makes.set('color', "mc saci")
    Makes.set('category', "mc saci")
    Makes.set('brand', "mc saci")
    try {
      await Makes.save();
    } catch (error) {
      alert('Erro na atualização:', error)
    };
  };

  const deleteMake = async function (makeId) {
    const Makes = new Parse.Object('makes');
    Makes.set('objectId', makeId);
    try {
      await Makes.destroy();
      fetchAllMakes();
    } catch (error) {
      alert('Erro ao apagar:', error)
    };
  };

  useEffect(() => {
    fetchAllMakes();
  }, []);

  return (
    <div>
      <div className="header">
        <img
          className="header_logo"
          alt="Back4App Logo"
          src={
            'https://blog.back4app.com/wp-content/uploads/2019/05/back4app-white-logo-500px.png'
          }
        />
        <p className="header_text_bold">{'React on Back4App'}</p>
        <p className="header_text">{'To-do List'}</p>
      </div>
      <div className="container">
        <div className="flex_between">
          <h2 className="list_heading">Todo List</h2>
          {/* To-do read (refresh) button */}
          <Button
            type="primary"
            shape="circle"
            color={'#208AEC'}
            size={'default'}
            onClick={fetchAllMakes}
            icon={<RedoOutlined />}
          ></Button>
        </div>
        <div className="new_todo_wrapper flex_between">
          {/* Todo create text input */}
          <Input
            value={''}
            onChange={(event) => ''}
            placeholder="New Todo"
            size="large"
          />
          {/* Todo create button */}
          <Button
            type="primary"
            className="create_todo_button"
            color={'#208AEC'}
            size={'large'}
            onClick={createMake}
            icon={<PlusOutlined />}
          >
            Add
          </Button>
        </div>
        <div>
          {/* Todo read results list */}
          {fetchAllMakes !== null &&
            fetchAllMakes !== undefined &&
            readResults.length > 0 && (
              <List
                dataSource={readResults}
                renderItem={(item) => (
                  <List.Item className="todo_item">
                    <p
                      className={
                        item.get('done') === true
                          ? 'todo_text_done'
                          : 'todo_text'
                      }
                    >
                      {item.get('title')}
                    </p>
                    <div className="flex_row">
                      {/* Todo update button */}
                      {item.get('done') !== true && (
                        <Button
                          type="primary"
                          shape="circle"
                          className="todo_button"
                          onClick={() => updateTodo(item.id, true)}
                          icon={
                            <CheckOutlined className="todo_button_icon_done" />
                          }
                        ></Button>
                      )}
                      {/* Todo delete button */}
                      <Button
                        type="primary"
                        shape="circle"
                        className="todo_button"
                        onClick={() => deleteTodo(item.id)}
                        icon={
                          <CloseOutlined className="todo_button_icon_remove" />
                        }
                      ></Button>
                    </div>
                  </List.Item>
                )}
              />
            )}
        </div>
      </div>
    </div>
  );
}

export default App;
